import React, { useState } from 'react';

const FEATURE_COUNT = 11;

function App() {
  const [features, setFeatures] = useState<number[]>(Array(FEATURE_COUNT).fill(0));
  const [result, setResult] = useState<null | {
    prediction: string;
    probability: string;
    details: string;
  }>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleFeatureChange = (idx: number, value: string) => {
    const newFeatures = [...features];
    newFeatures[idx] = Number(value);
    setFeatures(newFeatures);
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setResult(null);
    try {
      const res = await fetch('http://localhost:3000/predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ features }),
      });
      if (!res.ok) throw new Error('Prediction failed');
      const data = await res.json();
      setResult(data);
    } catch (err) {
      setError('Failed to get prediction');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 600, margin: '2rem auto', fontFamily: 'sans-serif' }}>
      <h1>Loan Classifier Demo</h1>
      <form onSubmit={handleSubmit}>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: 8 }}>
          {features.map((val, idx) => (
            <div key={idx} style={{ flex: '1 0 120px' }}>
              <label>
                Feature {idx + 1}:<br />
                <input
                  type="number"
                  value={val}
                  onChange={e => handleFeatureChange(idx, e.target.value)}
                  style={{ width: '100%' }}
                  required
                />
              </label>
            </div>
          ))}
        </div>
        <button type="submit" disabled={loading} style={{ marginTop: 16 }}>
          {loading ? 'Predicting...' : 'Predict'}
        </button>
      </form>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {result && (
        <div style={{ marginTop: 24, padding: 16, border: '1px solid #ccc', borderRadius: 8 }}>
          <h2>Prediction Result</h2>
          <p><strong>Prediction:</strong> {result.prediction}</p>
          <p><strong>Probability:</strong> {result.probability}</p>
          <p><strong>Details:</strong> {result.details}</p>
        </div>
      )}
    </div>
  );
}

export default App;
